import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';

const Targets = () => {
  return (
    <div className="btn-group-vertical bg-danger" role="group" aria-label="Vertical button group">
      <Link to="/Davis" className="btn btn-primary">
        Davis
      </Link>
      <Link to="/Maow" className="btn btn-primary">
        Maow
      </Link>
      <Link to="/Nico" className="btn btn-primary">
        Nico
      </Link>
    </div>
  );
};

export default Targets;
